import React from 'react';
import './TrailersLanding.css';
import Navigation from './Navigation/Navigations';
import Narcos from '../narcos.png';


function Landing(props){

    return(
        <div className='header-one'>
        <Navigation />
        <div className="narcos">
        <img src={Narcos}  alt="narcos"/>
        <div className="about">
        <p>Narcos is an American crime drama web television series created and produced by<br /> Chris Brancato, Carlo Bernard, and Doug Miro.</p>
        </div>

        </div>
        {/* <div className="header">
        <h1>{props.name}</h1>
        
      <h3>{props.title}</h3>
      <div className="a-group">
      <a href ="/" onClick={props.genre}>Watch Now</a>
      </div>
      
      
       
       
        
        </div> */}
    
        </div>
        
    )
};

export default Landing;
